import React from 'react'
import '../pages-styles/home.css'
import Navbar from '../component/Navbar';
import Footer from '../component/Footer';
import ProjectsCard from '../component/ProjectsCard';
import CertificationSlider from '../component/Certification-Slider';
import HeadingText from '../component/HeadingText';
import ProjectCardDesign from '../component/ProjectCardDesign';
function Home () {
  return (
    <>
    <Navbar/>
    <HeadingText text="Skills"/>
    <HeadingText text="Projects" para="Hey"/>
    <ProjectsCard/>
    <ProjectCardDesign/>
    <HeadingText text="Internship"/>
    <HeadingText text="Experience"/>
    <CertificationSlider/>
    <Footer/>
    </>
    
  )
}

export default Home;
